\caption{Real parts (left) and imaginary parts (right) of quasinormal frequencies for the Reissner-Nordstr\o{}m\xspace black hole,
at mode number (top to bottom) $n=30,5000,10000$.  The red line is the numerical data of
\cite{Berti:2003zu} and the black line is the asymptotic formula \eqref{asymptotic-qnf-reissner-nordstrom-4d-rewritten}.  
